import React from 'react';
import { NavLink } from 'react-router-dom';
const home = () => {
    return (
        <div className="homePage">
          <h1>Greetings!</h1>
        <div className="homeContainer">
           <div className="homeChild">

         <NavLink className="navL" to="/about">Quiz</NavLink>
      </div>
      
      </div>
     
      </div>
    );
}
 
export default home;
